import React from "react";

export const Navbar = () => {
  return (
    <header className="flex">
      <div className="">
        <h2 className="text-green-300 text-5xl">MovieDB</h2>
      </div>
      <nav>
        <ul>
          <li>
            <a href="#">Movie</a>
          </li>
          <li>
            <a href="#">TV</a>
          </li>
          <li>
            <a href="#">Actors</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
